import Tile from '../Tile/Tile'
import './LetterTray.css'
export default function LetterTray(props) {
  return (
    <div className='tray-container'>
         <Tile letter={'a'} setIsMouseDown={props.setIsMouseDown} isMouseDown={props.isMouseDown}></Tile>
         <Tile letter={'b'} setIsMouseDown={props.setIsMouseDown} isMouseDown={props.isMouseDown}></Tile>
         <Tile letter={'c'} setIsMouseDown={props.setIsMouseDown} isMouseDown={props.isMouseDown}></Tile>
    </div>
  )
}
